window.bookSummaryJSON = "<p>Monica Samuels is in trouble. Just six weeks after her graduation from the Warner Naval Academy, <i>Pathfinder</i>, her ship, was stolen by other members of the crew. They round up everyone and put them off the ship, but at the last minute, her captain sends her back to join with the thieves.</p> <p>No instructions, no plans, no weapons, no backup. What was Captain Brighton thinking?</p> <p>There's no way to tell now, but she had better figure it out fast. The thieves are getting closer to delivering Pathfinder, her secret is only one slip away from being discovered, and there's no one she can trust. But Samuels has vowed to do her duty and protect her ship. In order to do that, she must bring those responsible to their Day of Reckoning.</p>"; 
